  if (c0 === '-' || c0 === '+') {
    str = str.substring(1);
    if (c0 === '-') {
      sign = '-';
    }
  }

  var d0 = str[0];
  str = str.substring(1);

  var mantissa = Number(sign + d0 + '.' + str);
  var expt = str.length;

  return [mantissa, expt];
};

